import React, { useState } from "react";
import { useForm } from "react-hook-form";


const Formwithhook = () => {
    const [userInfo, setUserinfo] = useState()
    const { register, handleSubmit, errors } = useForm()
    const onSubmit = (data) => {

        setUserinfo(data)
        console.log(data)
    }
    const Click = () =>{
        console.log("clicked")
    }
    return (
        <div>
            <h2>Form with form-hook library</h2>
            <div>{JSON.stringify(userInfo, undefined, 2)}</div>
            <form onClick={handleSubmit(onSubmit)}>
                <div>
                    <label>username: </label>
                    <input type="text" name="username" placeholder="username" {...register("username")}></input>
                </div>
                <div>
                    <label>email: </label>
                    <input type="text" name="email" placeholder="email" {...register("email")}></input>
                </div>
                <div>
                    <label>password: </label>
                    <input type="password" name="password" placeholder="password" {...register("password")}></input>
                </div>
                <button type="button" onClick={Click}>Register</button>
            </form>
        </div>
    )
}
export default Formwithhook;
